import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 18.2-152.6 Theft of computer services; penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-152.6.md","filePath":"vacode/18.2-152.6.md"}'),i={name:"vacode/18.2-152.6.md"},o=a('<h1 id="§-18-2-152-6-theft-of-computer-services-penalties" tabindex="-1">§ 18.2-152.6 Theft of computer services; penalties. <a class="header-anchor" href="#§-18-2-152-6-theft-of-computer-services-penalties" aria-label="Permalink to &quot;§ 18.2-152.6 Theft of computer services; penalties.&quot;">​</a></h1><p>Any person who willfully obtains computer services without authority is guilty of the crime of theft of computer services, which shall be punishable as a Class 1 misdemeanor. If the theft of computer services is valued at $2,500 or more, he is guilty of a Class 6 felony.</p><p>1984, c. 751; 1985, c. 322; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0987" target="_blank" rel="noreferrer">987</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1016" target="_blank" rel="noreferrer">1016</a>; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0746" target="_blank" rel="noreferrer">746</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0761" target="_blank" rel="noreferrer">761</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0827" target="_blank" rel="noreferrer">827</a>.</p>',3),s=[o];function l(c,n,f,p,h,_){return t(),r("div",null,s)}const v=e(i,[["render",l]]);export{u as __pageData,v as default};
